import React from 'react';
import './index.css';
import './styles.css'

export default function ListingAd({ pic, title, address, description }) {
  return (
    <div className="App">
      <img className="" src={pic} />
      <div>

      </div>
      <div className='flex flex-row'>
        <img src={pic} style={{height: 40, width: 40}}/>
        <div className='flex flex-col'>
          <div>{address}</div>
          <div>{title}</div>
        </div>
      </div>

    </div>
  );
}
